function timeLine(){let timelineContainer=$("#timelineContainer");$.getJSON(`${_baseUrl}api/v1/timeline/ts`,(function(data,textStatus,jqXHR){data.forEach((function(item,index){let timelineClass,timelineItem=`<div class="timeline-item ${index%2==0?"left":"right"}">\n                                <i class="icon ${item.ico}"></i>\n                                <div class="date">${item.date}</div>\n                                <div class="content">\n                                    <div class="d-flex">\n                                        <div class="flex-shrink-0">\n                                            <img src="/assets/images/users/user-dummy-img.jpg" alt="" class="avatar-sm rounded">\n                                        </div>\n                                        <div class="flex-grow-1 ms-3">\n                                            <h5 class="fs-15">${item.desc} <small class="text-muted fs-13 fw-normal"> - ${item.timeAgo} </small></h5>\n                                            <p class="ts-3 text-muted mb-2">${item.obs}</p>\n                                            <div class="hstack gap-2">\n                                                <button class="btn btn-sm btn-primary" onclick="edit('${item.id}')">Editar</button>\n                                                \x3c!-- <a class="btn btn-sm btn-light"><span class="me-1">&#128293;</span> {ITEM}</a>\n                                                <a class="btn btn-sm btn-light"><span class="me-1">&#129321;</span> {ITEM}</a> --\x3e\n                                            </div>\n                                        </div>\n                                    </div>\n                                </div>\n                            </div>`;timelineContainer.append(timelineItem)}))}))}function edit(id){Swal.fire({html:"Recurso indispon√≠vel no momento<br><b>ID: </b>"+id,icon:"error"})}$(document).ready((function(){timeLine()}));